import React from "react";
import "./Hero.css";

function Hero() {
  return (
    <>
      <div className="hero">
        <div className="hero-container">
          <div className="hero-conteudo">
            <div className="hero-coluna-1">
              <div className="hero-coluna-1-slider-1">
                
              </div>
            </div>
            <div className="hero-coluna-2">
              
            </div>
          </div>
        </div>
      </div>
    </>
  );
}

export default Hero;
